text:
Hi, I am Anubhav from ramanlabs.<p>We have been working on a self hosted solution to enable natural language search for videos and images. Idea is to allow users to Index all locally available images and videos just once, and then later query them using  natural language. It doesn&#x27;t depend on any deep-learning framework and should make installation easier and faster. All Indices are stored locally without no dependence on outside network.
Semantic search is powered by CLIP architecture.<p>We already have some features on the roadmap and are interested in hearing your feedback&#x2F;thoughts.<p>Github: &lt;<a href="https:&#x2F;&#x2F;github.com&#x2F;ramanlabs-in&#x2F;hachi">https:&#x2F;&#x2F;github.com&#x2F;ramanlabs-in&#x2F;hachi</a>&gt;
Demo: &lt;<a href="https:&#x2F;&#x2F;demo.ramanlabs.in" rel="nofollow">https:&#x2F;&#x2F;demo.ramanlabs.in</a>&gt;
